import React from 'react'
import PropTypes from 'prop-types'

const options = {
  headers: {
    "Content-Type": "application/json",
    "Access-Control-Allow-Origin": "*"
  }
}

class Records extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      data: []
    }
  }

  componentDidMount() {
    fetch("http://localhost:4000/api/records/lookup?procedureDescription=xray&limit=50&hospital=Mount+Sinai", options)
      .then(data => {
        //console.log(data);
        this.setState(data)
      })
  }

  render () {
    return(
    <div>
        <h4>Recent inserts</h4>
        {this.state.data.map(record => (
          <p>{record.procedureName}</p>
        ))}
    </div>
  )
  }
}

export default Records;
